المقادير : 
للعجينة :
ثلاثة أرباع الكوب حليب دافئ
2 ملعقة صغيرة خميرة
2 ملعقة صغيرة سكر 
2 ملعقة كبيرة زيت نباتي 
2 كوب طحين 
1 ملعقة صغيرة ثوم مهروس 
رشة ملح وملعقة صغيرة أوريغانو 

@lovelyfamily2016

للحشوة : 2 ملعقة كبيرة زبدة مذابة
4 فصوص ثوم مهروس 
ملعقة كبيرة أوريغانو 

جبنة موزاريلا 
كزبرة مفرومة ناعم ( اختياري )
@lovelyfamily2016
طريقة التحضير : 
1. نضع الحليب في وعاء ومعه السكر والخميرة نحرك جيداً ليذوب السكر 
ثم نضيف الزيت والثوم والاوريغانو ونحرك 
بعدها نضع الطحين ونعجن لنحصل على عجينة طرية 

نغطيها ونتركها ترتاح مدة 45 دقيقة الى ساعة 🕓

2. نحضر الحشوة بتحريك الثوم المهروس والاوريغانو مع الزبدة المذابة 

بعد مرور الوقت 🕓 نقطع العجينة لقسمين او اربعة حسب الرغبة 

3. نفرد قطعة العجين بشكل دائري ثم ندهنها بخليط الحشوة ونضع جبنة الموزاريلا وممكن رشة كزبرة مفرومة ناعم ونغلق العجينة 

ثم نضعها في صينية فرن عليها ورق زبدة او مدهونة بزيت 

4. نغطيها ونتركها ترتاح مدة 20 دقيقة 🕓👍

5. نمرر سكينة على العجينة لاعطاءها شكل ونزينها برشة كزبرة وفلفل أحمر

6. ثم ندخلها الفرن على الرف الوسط بدرجة حرارة 180 
تحتاج تقريباً مدة 10 دقائق من الاسفل 
ثم نشغل من الاعلى لتأخذ لون فقط 

وصحتين وألف عافية يارب 😍❤️
